import os
import base64

class Files:

    @staticmethod
    def create_file_structure():
        if not os.path.exists('data'):
            os.mkdir('data')
        if not os.path.exists('data/accounts'):
            os.mkdir('data/accounts')
        if not os.path.exists('data/chatgpt.txt'):
            with open('data/chatgpt.txt', 'w') as fp:
                pass
        if not os.path.exists('data/linkbot.txt'):
            with open('data/linkbot.txt', 'w') as fp:
                pass
        if not os.path.exists('data/config.json'):
            with open('data/config.json', 'w') as fp:
                fp.write('{"profile":{"enabled":false,"first_name":["-"],"last_name":["-"],"username":["-"],"bio":["-"],"photo":"photo/","hidden":false,"fa":false},"autoposts":{"enabled":false,"channels":["-"],"uniqalize":false,"posts_count":"0","posts":["-"],"count":"-","delay":"-"},"autocomments":{"enabled":true,"uniqalize":false,"posts":["-"]},"autojoin":{"enabled":false,"delay":"-","channels":["-"],"all":false}}')
        if not os.path.exists('data/profile_pics'):
            os.mkdir('data/profile_pics')
            with open('data/profile_pics/1.jpg', 'wb') as fp:
                fp.write(base64.b64decode(''))
        return None